import {withRouter} from 'next/router'
import Layout from '../components/layout'
import styles from './post.scss'

const Page = withRouter((props) => {
  console.log(style)
  return (
      <Layout>
          <h3 className={styles.example}>Post Page</h3>
          <p>Info:{props.router.query.title}</p>
      </Layout>
  )
})

export default Page
